import React from "react";
import NavComponents from "./NavComponent";
function App() {
  let bodyStyle = {height: "100", backgroundColor: "black" };

  return (
    <div style={bodyStyle}>
      <nav>
        <NavComponents />
      </nav>
    </div>
  );
}

export default App;
